let task;
export default class Task {
    task;
    constructor(date, time, title, description, category, priority){
        task = {
            date: this.date,
            time: this.time,
            description: this.description,
            category: this.category,
            priority: this.priority
        }
    }
    getTask = () =>{
        return task;
    }
}
